import React from 'react'
import '../css/planssidebar.css'

const PlansSideBar = () => {
    return (
        <div className="plans-sidebar">
            <div className="plans-sidebar-grid-box">
                <div className="plans-sidebar-bookmark">My Bookmarks</div>
                <div className="plans-sidebar-skills">My Skills</div>
            </div>
        </div>
    )
}

export default PlansSideBar
